import React from 'react';
import About from '../../About';
import {homeObjFour, homeObjOne} from './Data';
import Pricing from '../../Pricing';


function Projects() {
    return (
        <>
            <About {...homeObjOne} />
            <Pricing/>
            <About {...homeObjFour} />
        </>
    );
}

export default Projects;
